export const articleContent = `
<h2 id="mcetoc_1fbgagcfco" style="text-align: start;"><span style="font-family: 'times new roman', times, serif;">题目描述</span></h2>
<p><span style="font-family: 'times new roman', times, serif;">给定一个整数数组 nums 和一个整数目标值 target，请你在该数组中找出 和为目标值 target &nbsp;的那 两个 整数，并返回它们的数组下标。</span></p>
<p><span style="font-family: 'times new roman', times, serif;">你可以假设每种输入只会对应一个答案。但是，数组中同一个元素在答案里不能重复出现。</span></p>
<p><span style="font-family: 'times new roman', times, serif;">你可以按任意顺序返回答案。</span></p>
<h2 id="mcetoc_1fbgagcfcp" style="text-align: start;"><span style="font-family: 'times new roman', times, serif;">示例</span></h2>
<pre class="language-code"><code>输入：nums = [2,7,11,15], target = 9
输出：[0,1]
解释：因为 nums[0] + nums[1] == 9 ，返回 [0, 1] 。
输入：nums = [3,2,4], target = 6
输出：[1,2] 。
输入：nums = [3,3], target = 6
输出：[0,1] 。</code></pre>
<h2 style="text-align: start;"><span style="font-family: 'times new roman', times, serif;">解题代码</span></h2>
<pre class="language-code"><code>class Solution:
    def twoSum(self, nums: List[int], target: int) -&gt; List[int]:
        for index, num in enumerate(nums):
            if target - num in nums and nums.index(target - num) != index:
                return [index, nums.index(target - num)]</code></pre>
<p><span style="font-family: 'times new roman', times, serif;">提交结果：</span></p>
<p><span class="mce-nbsp-wrap" contenteditable="false">&nbsp;&nbsp;&nbsp;</span><span class="mce-nbsp-wrap" contenteditable="false">&nbsp;&nbsp;&nbsp;</span><span class="mce-nbsp-wrap" contenteditable="false">&nbsp;&nbsp;&nbsp;</span><span class="mce-nbsp-wrap" contenteditable="false">&nbsp;&nbsp;&nbsp;</span><span style="font-family: 'times new roman', times, serif;">执行用时：680ms 超过了 30% 的 Pyhton3 提交记录</span></p>
<p><span class="mce-nbsp-wrap" contenteditable="false">&nbsp;&nbsp;&nbsp;</span><span class="mce-nbsp-wrap" contenteditable="false">&nbsp;&nbsp;&nbsp;</span><span class="mce-nbsp-wrap" contenteditable="false">&nbsp;&nbsp;&nbsp;</span><span class="mce-nbsp-wrap" contenteditable="false">&nbsp;&nbsp;&nbsp;</span><span style="font-family: 'times new roman', times, serif;">内存消耗：15MB 超过了 71% 的 Pyhton3 提交记录</span></p>
<p style="text-align: right;"><span style="font-family: 'times new roman', times, serif; font-size: 8pt;">来源：力扣（LeetCode）</span><br /><span style="font-family: 'times new roman', times, serif; font-size: 8pt;">链接：<span style="color: #ffffff;"><a style="color: #ffffff;" href="https://leetcode-cn.com/problems/two-sum" target="_blank" rel="noopener">https://leetcode-cn.com/problems/two-sum</a></span></span></p>`

